import React from 'react';
import './Dashboard.css';

const Dashboard = () => {
    return (
        <div className="dashboard">
            <header className="dashboard-header">
                <h1>Car Service Dashboard</h1>
            </header>
            <main className="dashboard-main">
                <section className="card service-summary">
                    <h2>Service Summary</h2>
                    <p>Upcoming Appointments: <strong>1</strong></p>
                    <p>Services in Progress: <strong>0</strong></p>
                    <p>Completed Services: <strong>5</strong></p>
                </section>
                <section className="card quick-actions">
                    <h2>Quick Actions</h2>
                    <button>Book New Service</button>
                    <button>View Service History</button>
                    <button>Manage Vehicles</button>
                    <button>Profile Settings</button>
                </section>
            </main>
        </div>
    );
};

export default Dashboard;
